            - strong [ref=e1498]: MedGemma 27B is competitive with GPT-4
            - text: on criterion-level matching (70% accuracy, F1 macro 0.722, Cohen's kappa 0.538 vs GPT-4 baseline 75%)
          - listitem [ref=e1499]:
            - strong [ref=e1500]: 27B dramatically outperforms 4B
            - text: (70% vs 35% accuracy) — the larger model has much better instruction-following for structured JSON output
          - listitem [ref=e1501]:
            - strong [ref=e1502]: MedGemma 4B has systematic MET bias
            - text: on exclusion criteria — model reasoning is often correct but the JSON label contradicts it (instruction-following failure, not a reasoning failure). Degraded further by max_tokens=512 TGI CUDA bug workaround
          - listitem [ref=e1503]:
            - strong [ref=e1504]: Gemini 3 Pro matches GPT-4 baseline
            - text: at 75% accuracy, confirming it as a strong general-purpose option for criterion evaluation
          - listitem [ref=e1505]:
